object Solution {
    def minimumIndex(nums: List[Int]): Int = {
        val freq = nums.groupBy(identity).mapValues(_.size)
        val dominantElement = freq.find(_._2 > nums.length / 2).get._1
        var leftFreq = 0
        var rightFreq = freq(dominantElement)
        for (i <- nums.indices) {
            if (nums(i) == dominantElement) {
                leftFreq += 1
                rightFreq -= 1
            }
            if (leftFreq * 2 > i + 1 && rightFreq * 2 > nums.length - i - 1) return i
        }
        -1
    }
}
